(30, 13, 'JARA212730', 'Samsung A53', 'Samsung Galaxy A53 5G hadir dengan layar seluas 6,5 inci berjenis Super AMOLED dengan resolusi 1080 x 2400 piksel. Layar ini pun masih sama seperti pendahulunya.Samsung Galaxy A53 5G hadir dengan layar seluas 6,5 inci berjenis Super AMOLED dengan resolusi 1080 x 2400 piksel. Layar ini pun masih sama seperti pendahulunya.', 'Galaxy-A53-Galaxy.jpg', 5400000, '0.00', 12, 'pcs', 1, '2022-07-14 23:22:10'),
(31, 13, 'KPK112797', 'Samsung A13', 'NETWORK	Technology	\r\nGSM / HSPA / LTE\r\nLAUNCH	Announced	2022, March 04\r\nStatus	Available. Released 2022, March 23\r\nBODY	Dimensions	165.1 x 76.4 x 8.8 mm (6.5 x 3.01 x 0.35 in)\r\nWeight	195 g (6.88 oz)\r\nBuild	Glass front (Gorilla Glass 5), plastic frame, plastic back\r\nSIM	Single SIM (Nano-SIM) or Dual SIM (Nano-SIM, dual stand-by)\r\nDISPLAY	Type	PLS LCD\r\nSize	6.6 inches, 104.9 cm2 (~83.2% screen-to-body ratio)\r\nResolution	1080 x 2408 pixels, 20:9 ratio (~400 ppi density)\r\nProtection	Corning Gorilla Glass 5\r\nPLATFORM	OS	Android 12, One UI 4.1\r\nChipset	Exynos 850 (8nm)\r\nCPU	Octa-core (4x2.0 GHz Cortex-A55 & 4x2.0 GHz Cortex-A55)\r\nGPU	Mali-G52\r\nMEMORY	Card slot	microSDXC (dedicated slot)\r\nInternal	32GB 3GB RAM, 32GB 4GB RAM, 64GB 4GB RAM, 128GB 4GB RAM, 128GB 6GB RAM\r\n 	eMMC 5.1\r\nMAIN CAMERA	Quad	50 MP, f/1.8, (wide), PDAF\r\n5 MP, f/2.2, 123 (ultrawide), 1/5\", 1.12m\r\n2 MP, f/2.4, (macro)\r\n2 MP, f/2.4, (depth)\r\nFeatures	LED flash, panorama, HDR\r\nVideo	1080p@30fps\r\nSELFIE CAMERA	Single	8 MP, f/2.2, (wide)\r\nVideo	1080p@30fps', 'samsung.a13.jfif', 2350000, '0.00', 12, 'pcs', 1, '2022-07-22 21:06:37'),
(32, 13, 'KPK112830', 'Samsung Galaxy A23 5G', 'hp Samsung terbaru ini ditenagai prosesor Snapdragon 695 yang disokong RAM 6 GB lengkap bersama fitur RAM Plus (hingga 6 GB). Untuk ruang penyimpanan internal sebesar 128 GB yang bisa diperluas hingga 1 TB dengan microSD.\r\n\r\nGalaxy A23 5G turut dibekali empat kamera belakang yang terdiri dari lensa utama 50 MP, lensa ultrawide 5 MP, sensor depth 2 MP dan sensor macro 2 MP serta kamera selfie 5 MP.\r\n\r\nHp Samsung ini mengusung layar Infinity-V Display berukuran besar 6,6 inci dengan resolusi tinggi Full HD+ serta refresh rate 120Hz. Dari sisi daya, Galaxy A23 5G telah dibekali dengan baterai besar 5.000 mAh dengan dukungan 25W Fast Charging.', 'Samsung-Galaxy-A32.jpg', 4350000, '0.00', 12, 'PCS', 1, '2022-07-22 21:07:10'),
(33, 13, 'NRK112863', 'Samsung Galaxy A73 5G', 'Kamera utama pada Samsung Galaxy A73 5G didukung oleh kamera 12 MP,  5 MP dan 5 MP. Sedangkan di bagian depan ada kamera selfie yang memiliki resolusi 32 MP.\r\n\r\nSamsung Galaxy A73 5G sendiri ditenagai prosesor Snapdragon 778G yang tersedia dalam pilihan RAM 8 GB dengan penyimpanan internal 256 GB. Pilihan warnanya ada Awesome Gray, Awesome White, serta Awesome Mint.', 'a73_5g.jfif', 7650000, '0.00', 12, 'pcs', 1, '2022-07-22 21:07:43'),
(34, 15, 'SGZF5H24623', 'Samsung Galaxy Z Fold4 5G', 'Network: 2G, 3G, 4G, 5G\r\nOS: Android 12L, One UI 4.1.1\r\nChipset: Qualcomm SM8475 Snapdragon 8+ Gen 1 (4 nm)\r\nCPU: Octa-core (13.19 GHz Cortex-X2 & 32.75 GHz Cortex-A710 & 41.80 GHz Cortex-A510)\r\nGPU: Adreno 730\r\nRAM: 12GB\r\nMemori: 256GB, 512GB, 1TB\r\nDimensi: 1 x 130.1 x 6.3 mm (tertutup), 155.1 x 67.1 x 14.2-15.8 mm (terbuka), 263 g\r\nLayar: 7.6 inches Foldable Dynamic AMOLED 2X, 120Hz, HDR10+, 1200 nits (peak), Cover display: Dynamic AMOLED 2X, 120Hz, Corning Gorilla Glass Victus+', 'Z-Fold4-5G1.jpg', 24999000, '0.00', 4, 'pcs', 1, '2022-11-10 06:37:03'),
